import React, { useEffect }from 'react';
import { useParams } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { findlistings } from '../../store/listings';
// import { getlisting } from '../../store/listings';

import './listing.css';
// import { getlistings } from '../../store/listings';
function ListingPage(){
    const { id } = useParams();
    console.log(id)
    const dispatch = useDispatch();
    const listingState = useSelector(state => state.listing);
    const listing = Object.values(listingState);
    console.log(listingState)
    console.log(listing)
    useEffect(() => {
        dispatch(findlistings(id));
        }, [dispatch, id])

    return(
    <div className='explore-page'>
        <h1>THIS IS LISTING PAGE BY ID</h1>
        <div>{listing.name}</div>
        <div className='listing-main'>
            <Link className='listing-info' to={`/listings/${listing.id}`}>
                {photos.map((el) => <img src={el.photo}></img>)}
            </Link>
            <div className='listing-description'>
                <p className='listing-name'>Name---{listing.name}</p>
                <p className='listing-description'>Description---{listing.description}</p>
                <p className='listing-address'>Address---{listing.address}</p>
                <p className='listing-price'>Price Per Night---${listing.price}</p>
                <p className='listing-guests'># of Guests---{listing.guests}</p>
                <p className='listing-bedrooms'># of Bedrooms---{listing.bedrooms}</p>
                <p className='listing-baths'># of Baths---{listing.baths}</p>
                <p className='listing-coordinates'>latitude:---{listing.latitude},longitude:---{list.longitude}</p>
            </div>
        </div>
    </div>

    )
}
  export default ListingPage;

